import React from 'react';
import 'App.css';

function StateTable() {
    return (

        <div className="container" class=".center" style={{
            alignItems: "center"

        }}>
            <div className="row">
                <div className="col-5" style={{
                     border: "1px solid gray"
                }}>.col-5</div>
                <div className="col-5" style={{
                     border: "1px solid gray"
                }}>.col-5</div>
                <div className="col-4">.col-4</div>
                <div className="col-6">.col-6</div>
            </div>
        </div>

    )
}

export default StateTable;
